import React from 'react';
import Card from './Card'


const Cardlist = ({ movies }) => {
    const CardArray = movies.map((data, i) => {
        return <Card key={i} id={movies[i].id} poster_path={movies[i].poster_path} title={movies[i].title} />
    })
    return (
        <div>
            {CardArray}
        </div>
    )
}
export default Cardlist;
